import React from 'react';
import TableHeader from "./TableHeader/TableHeader";
import classes from "./ProductTable.module.css";
import Row from "./Row/Row";

const ProductTable = () => {
    return (
        <div className={classes.container}>
            <TableHeader/>
            <Row className="test"/>
        </div>
    );
};

export default ProductTable;
